import React from 'react';

function ImporterDonnees() {
  return (
    <div>
      <h2 className="text-2xl font-semibold mb-4">Importer des données</h2>
      <p className="text-gray-700">
        Ici, vous pourrez importer vos fichiers Excel contenant les données à charger dans la base.
      </p>
    </div>
  );
}

export default ImporterDonnees;
